import React, { useState } from 'react'

function Movement() {

    const [Movement,setMovement] = useState("Stop");

    return (
        window.addEventListener('keydown', (event) => {
            switch (event.key){
                case 'ArrowUp': {setMovement('Up')} break;
                case 'ArrowDown': console.log('Giù'); break;
                case 'ArrowLeft': console.log('Sinistra'); break;
                case 'ArrowRight': console.log('Destra'); break;
            }
        })
    )
}

export default Movement
